import App, {AppProps} from "next/app";

class Base extends App {
    static async getInitialProps({ Component, ctx }: AppProps) {
        const pageProps = Component.getInitialProps
            ? await Component.getInitialProps(ctx)
            : {}
        return pageProps;
    }
}

export default Base
